import './App.css';
import Header from './components/Header';
import Coinpage from './pages/Coinpage';
import Home from './pages/Home';

function App() {
  return (
    <div>
      <BrowserRouter>
        <div>
          <Header/>
          <Route path='/' component={Home} exact>
            <Route path='/coins/:id' component={Coinpage}></Route>

          </Route>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
